text:
#OTD in Nebraska history: The North Platte Daily Bulletin shared a clipping showcasing the generosity of the North Platte Canteen in U.S. Army newspapers around the world.

During World War II Nebraskans provided soldiers passing through by rail with refreshments and free birthday cakes. Each cake claimant was asked to sign an affidavit to ensure he "not kidding about when he was born."

@SenatorFischer and I have introduced a bill to award the Congressional Gold Medal to Canteen volunteers for their patriotic efforts.
